import React, { useState } from 'react';
import BlockService from '../services/BlockService';

function CreateBlock() {
  const [thisBlock, setThisBlock] = useState('');
  const [nextBlock, setNextBlock] = useState('');

  const handleSubmit = async e => {
    e.preventDefault();
    await BlockService.createBlock({ thisBlock, nextBlock });
    // Reset form fields or perform other actions after creating
    setThisBlock('');
    setNextBlock('');
  };

  return (
    <div>
      <h2>Create Block</h2>
      <form onSubmit={handleSubmit}>
        <label>
          ThisBlock:
          <input
            type="text"
            value={thisBlock}
            onChange={e => setThisBlock(e.target.value)}
          />
        </label>
        <br />
        <label>
          NextBlock:
          <input
            type="text"
            value={nextBlock}
            onChange={e => setNextBlock(e.target.value)}
          />
        </label>
        <br />
        <button type="submit">Create</button>
      </form>
    </div>
  );
}

export default CreateBlock;
